import React from 'react';
import CustomeButtonContainer from './custom-button.styles'

const CustomButton = ({ children, ...otherProps }) => (
    <CustomeButtonContainer {...otherProps}>
        {children}
    </CustomeButtonContainer>
)

export default CustomButton;
